import './App.css';
import FileIcons from './FileIcons';

function App() {
  return (
    <div className="App">
      <div className="header">
        <img src="https://ssl.gstatic.com/images/branding/product/1x/drive_2020q4_48dp.png" style="width:40px;height:40px" alt="test" />
      </div>
      <FileIcons />
    </div>
  );
}

export default App;
